function removeDuplicates(s: string, k: number): string {
  const stack: { char: string, count: number }[] = []

  for (let i = 0; i < s.length; i++) {
    const char = s[i]

    if (char === stack[stack.length - 1]?.char) {
      stack[stack.length - 1].count++
    } else {
      stack.push({ char, count: 1 })
    }

    if (stack[stack.length - 1]?.count === k) {
      stack.pop()
    }
  }

  return stack.reduce((sum, item) => (sum + Array(item.count).fill(item.char).join('')), '')
}

console.log(removeDuplicates('abcd', 2))
console.log(removeDuplicates('deeedbbcccbdaa', 3))
